import React from 'react'
import Grid from '@material-ui/core/Grid'
import Paper from '@material-ui/core/Paper'
function RenderRow({ row }) {
    //var rowvals={row}.toString().split("").map((x)=>+x);
    return (
        <div>
            {row.map((item) => {
                return (
                    <span>Item={item} </span>
                )
            })}
        </div>
    )
}
const Ticket = ({ ticket }) => {
    //console.log({row1}.toString());
    return (
        <div>
            {ticket.map((row) => {
                return (
                    <div className='rowOfTicket'>
                        {row.map((item) => {
                            return (
                                <span>Item={item}</span>
                            )
                        })}
                    </div>
                )
            })}
        </div>
    )
}
export default Ticket;
